/**
 * 字符串的 Cookie 转换为 对象
 * @param {String} str_cookie
 * @return Object
 */
lwVm.strCookieToObject = function (str_cookie) {
    let cookie_obj = {};
    for (const iterator of str_cookie.split(';')) {
        let values = iterator.split('=');
        if (values.length == 2) {
            let key = values[0].replace(/^\s+|\s+$/g, "")
            cookie_obj[key] = values[1]
        }
    }
    return cookie_obj;
}


